import React from "react";
import "./team.css";
import image from "../images/christiano.jpg";
import linka from "../images/facebook.png";
import linkb from "../images/medium.png";
import linkc from "../images/linkedin.png";
import teamdata from "./Teamdata"

const Team = () => {
  return (
    <div className="team">
      <div className="heading">
        <h1>
          Without bonding and coordination, every project is a failure. Look at
          who makes KICKSUP great. ;)
        </h1>

        <div className="members">
          <div className="card">
            <div className="cardimage">
              <img src={image}></img>
            </div>
            <div className="carddetails">
              <h2>Zidane</h2>
              <p>leadership and management</p>
              <div className="linkicons">
                <img src={linka} className="imageicon" alt=""></img>
                <img src={linkb} className="imageicon" alt=""></img>
                <img src={linkc} className="imageicon" alt=""></img>
              </div>
            </div>
          </div>

        </div>


        <div className="finaltext">
          <h1>and You! :)</h1>
        </div>
      </div>
    </div>
  );
};

export default Team;

{teamdata.map((e) => {
  return (
    // <NavLink to={`/getproductsone/${e.id}`}>
    //   <div className="products_items">
    //     <div className="product_img">
    //       <img src={e.url} alt="" />
    //     </div>
    //     <p className="products_name">{e.title.shortTitle}</p>
    //     <p className="products_offer">{e.discount}</p>
    //     <p className="products_explore">{e.tagline}</p>
    //   </div>
    // </NavLink>


    <div className="card">
            <div className="cardimage">
              <img src={e.url}></img>
            </div>
            <div className="carddetails">
              <h2>{e.name}</h2>
              <p>{e.role}</p>
              <div className="linkicons">
                <img src={e.linka} className="imageicon" alt=""></img>
                <img src={e.link} className="imageicon" alt=""></img>
                <img src={linkc} className="imageicon" alt=""></img>
              </div>
            </div>
          </div>
  );
})}
